    id: 27,
    name: "Elppa kooBcaM Air Core i5 8th Gen",
    slug: "elppa-koobcam-air-core-i5-8th-gen",
    permalink: "https://shippr.store/product/elppa-koobcam-air-core-i5-8th-gen/",
    date_created: "2019-10-06T18:59:12",
    date_created_gmt: "2019-10-06T18:59:12",
